using System;
using System.Linq;
using System.Diagnostics;

namespace StringBaseCalc
{
    class Program
    {
        static void Main()
        {
            Console.Write("Enter X: ");
            string X = Console.ReadLine();
            Console.Write("Enter Y: ");
            string Y = Console.ReadLine();

            X = "";
            Y = "";

            Stopwatch stopwatch = new Stopwatch();
            stopwatch.Start();

            Console.WriteLine($"Sum:     {Sum(X, Y)}");
            Console.WriteLine();

            stopwatch.Stop();
            Console.WriteLine(stopwatch.Elapsed);
        }

        private static string Sum(string X, string Y)
        {
            string sum = "";
            byte mind = 0;

            if (X.Length < Y.Length)
            {
                string temp = Y;
                Y = X;
                X = temp;
            }
            Y = new string('0', X.Length - Y.Length) + Y;

            for (int i = X.Length - 1; i >= 0; i--)
            {
                byte x = Convert.ToByte(X[i] - 48 + mind);
                byte y = Convert.ToByte(Y[i] - 48);

                if (x + y < 10)
                {
                    sum += $"{x + y}";
                    mind = 0;
                }
                else if (x + y >= 10)
                {
                    sum += $"{x + y}"[1];
                    mind = Convert.ToByte($"{x + y}"[0] - 48);
                }
            }

            sum += $"{mind}";

            return new string(sum.ToCharArray().Reverse().ToArray()).TrimStart('0');
        }
    }
}